def formato_pesos(df:pd.DataFrame,columnas:list):
    columnas_procesadas=[]
    for columna in columnas:
        #Agregamos columna si no está creada
        if columna not in df.columns:
            df[columna]=0
        else:
            pass

        assert columna not in columnas_procesadas, f'La columna {columna} está duplicada'
        df.loc[:,columna]=df[columna].apply(lambda x: None if pd.isna(x) else f'${x:,.0f}')
        columnas_procesadas.extend([columna])
    return df

def formato_fechas(df:pd.DataFrame,columnas:list):
    columnas_procesadas=[]
    for columna in columnas:
        #Agregamos columna si no está creada
        if columna not in df.columns:
            df[columna]=None
        else:
            pass

        assert columna not in columnas_procesadas, f'La columna {columna} está duplicada'
        df.loc[:,columna]=df[columna].apply(lambda x: None if pd.isna(x) else x.strftime('%d-%m-%Y'))
        columnas_procesadas.extend([columna])
    return df    

def formato_enteros(df:pd.DataFrame,columnas:list):
    columnas_procesadas=[]
    for columna in columnas:
        #Agregamos columna si no está creada
        if columna not in df.columns:
            df[columna]=None
        else:
            pass

        assert columna not in columnas_procesadas, f'La columna {columna} está duplicada'
        df.loc[:,columna]=df[columna].apply(lambda x: None if pd.isna(x) else f'{x:,.0f}')
        columnas_procesadas.extend([columna])
    return df  


def remove_accents(text):
    """Elimina acentos de una cadena de texto."""
    if isinstance(text, str):
        return ''.join(
            c for c in unicodedata.normalize('NFD', text)
            if unicodedata.category(c) != 'Mn'
        )
    return text

def clean_dict_accents(d):
    """Elimina acentos de todas las keys y values en un dict (anidado)."""
    if isinstance(d, dict):
        return {
            remove_accents(k): clean_dict_accents(v)
            for k, v in d.items()
        }
    elif isinstance(d, list):
        return [clean_dict_accents(item) for item in d]
    else:
        return remove_accents(d)


