class SISECpdf():
    def __init__(self,ruta:str,entidades_federativas:dict):
        self.entidades_federativas=entidades_federativas
        # ruta_raw=ruta.encode('unicode_escape')
        self.texto=self.genr_texto(ruta)
        self.validación_archivo() #Valida que el documento pdf cargado sea del tipo SISEC
        if self.archivo_sisec==True:
            self.get_datos_cliente()
            self.get_datos_patrones() 
        else:
            self.datos_cliente=pd.Series(name='Datos_Cliente',dtype='object')
            self.datos_cliente['Nombre']='Ilegible'
    def validación_archivo(self):
        self.archivo_sisec=self.texto[0].split('\n')[0]=='Instituto Mexicano del Seguro Social'
        
    def genr_texto(self,ruta):
        
        archivo=open(ruta,'rb')
        pdfreader=pdf.PdfReader(archivo)
        hojas=len(pdfreader.pages)
        if len==1:
            return pdfreader.pages[1].extract_text()
        else:
            diccionario_salida={}
            for hoja in range(0,hojas):
                diccionario_salida[hoja]=pdfreader.pages[hoja].extract_text()
            return diccionario_salida
    def get_datos_cliente(self):
        self.datos_cliente=pd.Series(name='datos_cliente',dtype='object')
        cadena=self.texto[0].replace('\nhistorial de registros afiliatorios de la persona asegurada','')
        enlista=cadena.split('\n')
        self.datos_cliente['Nombre']=enlista[4].split(':')[1]
        self.datos_cliente['nss']=enlista[5]
        curp=enlista[6].replace('CURP:','')
        self.datos_cliente['curp']=curp
        self.datos_cliente['semanas_cotizadas']=int(enlista[4].split(':')[0].replace('NSS',''))
        tuplas_fecha=cadena.split('Fecha de emisión del reporte\n')[1].split('\n')[0].replace(' ','').split('/')
        tuplas_fecha=[int(i) for i in tuplas_fecha]
        self.datos_cliente['fecha_emisión']=datetime.datetime(tuplas_fecha[2],tuplas_fecha[1],tuplas_fecha[0])
        self.datos_cliente['total_semanas_cotizadas_imss']=int(re.compile('^\d+').search(enlista[9]).group())
        self.datos_cliente['semanas_descontadas_por_disposicion_recursos']=int(re.compile('\s\d+\s').search(enlista[9]).group())
        self.datos_cliente['semanas_reintegradas']=int(re.compile('\d').search(enlista[9].split(' ')[2]).group())
        self.análisis_curp(curp)
    def análisis_curp(self,curp):
        string_fecha=re.compile('\d{6}').search(curp).group()
        año=int(string_fecha[0:2])
        año= 2000+año if año<20 else 1900+año
        mes=int(string_fecha[2:4])
        día=int(string_fecha[4:6])
        fecha_nacimiento=datetime.datetime(año,mes,día)
        self.datos_cliente['Fecha_Nacimiento']=fecha_nacimiento
        hoy=datetime.datetime.now()
        año_actual,mes_actual,día_actual=hoy.year,hoy.month,hoy.day
        edad_años=año_actual-año if datetime.datetime(2000,mes_actual,día_actual)>datetime.datetime(2000,mes,día) else año_actual-año-1
        self.datos_cliente['Edad']=edad_años
        self.datos_cliente['Sexo']=curp[10]
        self.datos_cliente['Entidad_Nacimiento']=self.entidades_federativas[curp[11:13]]
    @staticmethod
    def calcular_enteros_decimales(número:float,redondeo:int):
        #Devuelve una tupla con los valores enteros y decimales como cadena de texto
        número_redondeado_string=str(round(número,redondeo))
        return número_redondeado_string.split('.')
        


    def get_datos_patrones(self):
        self.patrones=pd.DataFrame()
