    def get_strings_resto(self,datos,num_págs,curp_cliente):
        patrones_resto=[]
        regex_fecha=re.compile('\n\d\d/\d\d/\d\d\d\d')
        for página in range(1,num_págs):
            #Separamos título
            lista=datos[página].split('Instituto Mexicano del Seguro Social\n ')
            #Separamos seprador de patrones
            nueva_lista=[]
            for elemento in lista:
                nueva_lista.extend(elemento.split('/* Valor del último salario base de cotización diario en pesos.'))
            #Evaluamos partes para que coincida con fecha inicial
            for cadena in nueva_lista:
                if regex_fecha.match(cadena):
                    self.get_patrones_de_string(curp_cliente,cadena)
                else:
                    pass
    def get_patrones_de_string(self,curp_cliente,string_patrón):
        segmentos=string_patrón.split('\n')
        registro_patronal=self.get_registropatronal(string_patrón).replace('\n','')
        self.patrones.loc[self.conteo_patrones,'Curp_cliente']=curp_cliente
        self.patrones.loc[self.conteo_patrones,'Nombre_Patrón']=self.get_nombre_patrón(string_patrón)
        self.patrones.loc[self.conteo_patrones,'Registro_Patronal']=registro_patronal
        self.patrones.loc[self.conteo_patrones,'Entidad_Federativa']=self.get_Estado(string_patrón)
        self.patrones.loc[self.conteo_patrones,'Fecha_Alta']=self.get_fecha_alta(string_patrón)
        self.patrones.loc[self.conteo_patrones,'Fecha_Baja']=self.get_fecha_baja(segmentos)
        self.patrones.loc[self.conteo_patrones,'Salario_Base']=self.get_salariobase(string_patrón)
        self.conteo_patrones+=1
    @staticmethod
    def get_Estado(string_patrón):
        regex_fecha=re.compile('\d\d/\d\d/\d\d\d\d')
        segmentos=string_patrón.split('Salario Base de Cotización')
        string=segmentos[0]
        resultado_fecha=regex_fecha.search(string)
        if resultado_fecha:
            span=resultado_fecha.span()
            inicio,fin=span[0],span[1]  
        else:
            regex_vigente=re.compile('Vigente')
            resultado_vigente=regex_vigente.search(string)
            span=resultado_vigente.span()
            inicio,fin=span[0],span[1]          
        estado=string[fin:].replace('\n','')
        return estado
    @staticmethod
    def get_registropatronal(string):
        regex=re.compile('Registro Patronal ')
        resultado=regex.search(string)
        inicio,fin=resultado.span()
        registro=string[fin:].split('\n')[0]

        return registro
    @staticmethod
    def formar_fecha(string):
        día,mes,año=string.split('/')
        return datetime.datetime(int(año),int(mes),int(día))
    def get_fecha_alta(self,string_patrón):
        regex_fecha=re.compile('\d\d/\d\d/\d\d\d\d')
        segmentos=string_patrón.split('Fecha de alta ')
        string2=segmentos[1]
        resultado_re=regex_fecha.search(string2)
        if resultado_re:
            span=resultado_re.span()
            inicio,fin=span[0],span[1]
            stringfecha=resultado_re.string[int(inicio):int(fin)]
            fecha=self.formar_fecha(stringfecha)
        else:
            fecha='Sin fecha'
        return fecha
    def get_salariobase(self,string_patrón):
        regex_dinero=re.compile('\$ \d*\.\d*')
        segmentos=string_patrón.split('Entidad federativa')
        string3=segmentos[1]
        resultado_re=regex_dinero.search(string3)
        if resultado_re:
            span=resultado_re.span()
            inicio,fin=span[0],span[1]
            string_salario=resultado_re.string[int(inicio):int(fin)]
        else:
            string_salario='Revisar fución get_salariobase'
        return string_salario
    def get_fecha_baja(self,segmentos):
        regex_fecha=re.compile('\d\d/\d\d/\d\d\d\d')
        string=segmentos[1]
        resultado_re=regex_fecha.search(string)
        if resultado_re:
            span=resultado_re.span()
            inicio,fin=span[0],span[1]
            stringfecha=resultado_re.string[int(inicio):int(fin)]
            return self.formar_fecha(stringfecha)        
        else:
            regex_vigente=re.compile('Vigente')
            resultado_re_vigente=regex_vigente.search(string)
            if resultado_re_vigente:
                return 'Vigente'
    def exportar_archivo(self):
        ruta=os.environ['RUTA_OUTPUTSISEC']
        nombre_archivo='\\'+datetime.datetime.now().strftime('%y%m%d')+' Sisec.xlsx'
        ruta=ruta+nombre_archivo
        with pd.ExcelWriter(ruta) as writer:
            self.clientes.to_excel(writer,sheet_name='Clientes')
            self.patrones.to_excel(writer,sheet_name='Patrones')
    def get_nombre_patrón(self,string_patrón):
        pattern=re.compile('Nombre del patrón')
        posicion_inicial=pattern.search(string_patrón).span()[1]
        pattern_final=re.compile('Registro Patronal')
        posicion_final=pattern_final.search(string_patrón).span()[0]
        patrón=None if posicion_inicial+1==posicion_final else string_patrón[posicion_inicial:posicion_final].replace('\n',"")

        return patrón



