class Análisis_Semanas():
    def __init__(self,datos:SISECpdf):
        if datos.archivo_sisec==False:
            pass
        else:
            self.datos_patrones=datos.patrones.copy()
            if self.datos_patrones.empty:
                self.duplicados=pd.DataFrame()
                self.ajuste_semanas=pd.DataFrame()
                self.salario_promedio=0
                self.trabajador_activo=False
                self.fecha_baja=False
                self.tipo_ley=97
                self.conservación_derechos_fecha_límite=False
            else:
                self.tipo_ley=73 if min(self.datos_patrones.Fecha_Alta)<datetime.datetime(1997,7,1) else 97
                self.trabajador_activo='Vigente' in self.datos_patrones.Fecha_Baja.tolist()
                self.datos_patrones['Fecha_Baja_Ajustada']=self.datos_patrones.Fecha_Baja.replace('Vigente',datos.datos_cliente.fecha_emisión)
                self.fecha_inicio_laboral=self.datos_patrones.sort_values('Fecha_Alta',ascending=True).iloc[0].Fecha_Alta
                self.ultimo_salario_mensual=float(self.datos_patrones.sort_values('Fecha_Baja_Ajustada',ascending=False).iloc[0].Salario_Base.replace('$',''))*30.4
                #Salario Promedio
                self.calcular_salario_promedio(self.datos_patrones)
                self.fecha_baja=max(self.datos_patrones.Fecha_Baja_Ajustada) #Fecha baja ajustada. Las validacioens de patrón activo se deben realizar sobre el parámetro trabajdor_activo
                self.año_baja=self.fecha_baja.year
                if self.tipo_ley==73:
                    self.conservación_derechos_fecha_límite=self.fecha_baja+datetime.timedelta(datos.datos_cliente.semanas_cotizadas*7*0.25)
                else:
                    self.conservación_derechos_fecha_límite=False
        



    def sobreposición_semanas(self,df:pd.DataFrame):
        df_análisis=pd.DataFrame()
        for idx,datos in df.iterrows():
            fechas=pd.date_range(datos.Fecha_Alta,datos.Fecha_Baja_Ajustada,freq='D')
            serie=pd.Series([1 for i in fechas],index=fechas,name=datos.Nombre_Patrón)
            df_análisis=pd.concat([df_análisis,pd.DataFrame(serie)],axis=1)
        días_netos=(df_análisis>=1).any(axis=1).sum()      
        días_brutos=df_análisis.sum().sum()     
        self.ajuste_semanas=pd.Series([días_brutos,días_netos],index=['días_brutos','días_netos'])

        filtro_duplicados=(df_análisis==1).sum(axis=1)>1
        self.duplicados=df_análisis[filtro_duplicados].dropna(axis=1,how='all')


    def calcular_salario_promedio(self,df:pd.DataFrame):
        df_salario=pd.DataFrame()
        for idx,datos in df.iterrows():
            fechas=pd.date_range(datos.Fecha_Alta,datos.Fecha_Baja_Ajustada,freq='D')
            serie=pd.Series([float(datos.Salario_Base.replace('$',"")) for i in fechas],index=fechas,name=datos.Nombre_Patrón)
            df_salario=pd.concat([df_salario,pd.DataFrame(serie)],axis=1)

        df_salario.sort_index(ascending=False,inplace=True)
        serie_promedio=df_salario.mean(axis=1)
        serie_promedio_últimas250semanas=serie_promedio[0:250*7]
        # print(len(serie_promedio_últimas250semanas))
        self.salario_promedio=serie_promedio_últimas250semanas.mean()


