class Cálculo_Pensión():
    # valores_uma={2024: 108.57, 2023: 103.74, 2022: 96.22, 2021: 89.62, 2020: 86.88, 2019: 84.49, 2018: 80.6, 2017: 75.49, 2016: 73.04}
    def __init__(self,nombre:str,edad:int,salario_promedio_diario:float,semanas_cotizadas:int,tipo_cálculo:str,fecha_baja_uma:datetime.datetime,último_salario_mensual:float,cuantía_incrementos:pd.DataFrame,mínimo_semanas=500,transitorio_14=1.11,salario_topado=25):
        assert tipo_cálculo in ['mejorada','original','proyeccion_60','proyeccion_61','proyeccion_62','proyeccion_63','proyeccion_64','proyeccion_65'],f'El tipo de cálculo {tipo_cálculo} no es válido.'
        self.nombre,self.edad,self.salario_promedio_diario,self.semanas_cotizadas,self.tipo_cálculo,self.fecha_baja_uma,self.último_salario_mensual,self.cuantía_incrementos,self.mínimo_semanas,self.transitorio_14,self.salario_topado=\
            nombre,edad,salario_promedio_diario,semanas_cotizadas,tipo_cálculo,fecha_baja_uma,último_salario_mensual,cuantía_incrementos,mínimo_semanas,transitorio_14,salario_topado
        self.edad= edad if edad<59 else max(60,edad)
        # self.edad=edad
        self.serie_pensión=pd.Series(dtype='object',name=tipo_cálculo)
        self.serie_pensión['nombre']=nombre
        self.serie_pensión['producto']='Mejora Pensión'
        self.serie_pensión['tipo_calculo']=tipo_cálculo
        self.serie_pensión['edad']=self.edad
        
        self.serie_pensión['fecha_baja_ultimo_patron_real']=fecha_baja_uma #Si está activo, es la fecha de emisión del reporte
        self.serie_pensión['salario_promedio']=round(self.salario_promedio_diario,2)
        uma=self.get_uma(fecha_baja_uma.year)
        self.serie_pensión['uma']=uma
        self.serie_pensión['semanas_cotizadas']=semanas_cotizadas
        self.serie_pensión['salario_topado']=salario_topado     
        self.cuantía_incrementos=cuantía_incrementos.copy()
        
      
        


        if False: #Validaciones a nivel modalidad 40
            pass

        else:

            grupo_salarial=round(self.salario_promedio_diario/uma,2)
            self.serie_pensión['grupo_salarial']=grupo_salarial
            incrementos_anuales=(semanas_cotizadas-mínimo_semanas)/52
            self.serie_pensión['incrementos_anuales']=incrementos_anuales
            
            cuantía,incrementos_anuales_porcentaje=self.lookup(grupo_salarial,self.cuantía_incrementos)
            self.serie_pensión['incrementos_anuales_porcentaje']=incrementos_anuales_porcentaje
            self.serie_pensión['cuantía']=cuantía

            incrementos_anuales_total=incrementos_anuales*incrementos_anuales_porcentaje
            self.serie_pensión['incrementos_anuales_total']=incrementos_anuales_total

            porcentaje_pensión=incrementos_anuales_total+cuantía
            self.serie_pensión['porcentaje_pensión']=porcentaje_pensión

            monto_diario=porcentaje_pensión*self.salario_promedio_diario
            self.serie_pensión['monto_diario']=monto_diario
            self.serie_pensión['transitorio_14']=transitorio_14

            monto_pensión_sin_edad=monto_diario*transitorio_14*30.4
            self.serie_pensión['monto_pension_sin_edad']=round(monto_pensión_sin_edad,2)
            
            porcentaje_por_edad=self.cálculo_porcentaje_por_edad(self.edad)
            self.serie_pensión['porcentaje_por_edad']=porcentaje_por_edad            

            Monto_Pensión_con_Edad=monto_pensión_sin_edad*porcentaje_por_edad
            self.serie_pensión['monto_pension_con_edad']=round(Monto_Pensión_con_Edad,2)
            self.serie_pensión['asignacion_familiar']=round(Monto_Pensión_con_Edad*0.15,2)

            pensión_con_af_mensual=Monto_Pensión_con_Edad*(1+0.15)
            self.serie_pensión['pension_neta_mensual']=int(pensión_con_af_mensual)
            self.serie_pensión['pension_neta_mensual_sin_formato']=self.serie_pensión.pension_neta_mensual
            self.serie_pensión['pension_neta_anual']=round(pensión_con_af_mensual*13,0)

            self.serie_pensión['ultimo_salario_mensual']=round(self.último_salario_mensual,2)
            self.serie_pensión['tasa_reemplazo']=round(pensión_con_af_mensual/self.último_salario_mensual,2)
            self.serie_pensión['tasa_reemplazo_porcentaje']= f'{self.serie_pensión["tasa_reemplazo"]:.0%}'
            


    @staticmethod
    def cálculo_porcentaje_por_edad(edad):
        if edad<60:
            return 0
        elif edad<65:
            return {60:0.75,61:0.80,62:0.85,63:0.90,64:0.95}[edad]
        else:
            return 1

    @staticmethod
    def lookup(number,df:pd.DataFrame):
        serie_diagnóstico=df.index<number
        if serie_diagnóstico.sum()==0:
            return df.tail(1).values[0]
        else:            
            return df[serie_diagnóstico].tail(1).values[0].tolist()
    @staticmethod
    def get_uma(año):
        valores_uma={2025:113.14,2024: 108.57, 2023: 103.74, 2022: 96.22, 2021: 89.62, 2020: 86.88, 2019: 84.49, 2018: 80.6, 2017: 75.49, 2016: 73.04}        
        try:
            return valores_uma[año]
        except:
            raise Exception(f'El valor de la Uma para el año {año} no está especificado')
  

        

