class Costo_Proyecto():
    # def __init__(self,nombre:str,meses:int,cuota_mensual:float,fecha_alta:datetime.datetime,aportación_efg:float,pensión_mensual_aumentada:float,saldo_afore_original:float,tablas_crédito:pd.DataFrame,tasa_m40=.0105,cuotas_patrón_r=0): Comentado para eliminar parámetro cuota mensual, pues ya no se utiliza. 
    def __init__(self,nombre:str,meses:int,fecha_alta:datetime.datetime,aportación_efg:float,pensión_mensual_aumentada:float,saldo_afore_original:float,tablas_crédito:pd.DataFrame,tasa_m40=.0105,cuotas_patrón_r=0):
        serie=pd.Series(dtype='object',name='financiamiento')
        serie['nombre']=nombre
        serie['tipo_calculo']='financiamiento'
        serie['diagnostico']=True
        # self.tabla_amortización=self.genr_tabla_amortización(meses,cuota_mensual,fecha_alta,tasa_m40)    Cambio a la de abajo al eliminar cuota mensual
        self.tabla_amortización=self.genr_tabla_amortización(meses,fecha_alta,tasa_m40)
        # serie['tabla_amortización']=self.tabla_amortización
        self.cuotas_patrón_r=cuotas_patrón_r
        serie['cuotas_patron_r']=self.cuotas_patrón_r
        self.subtotal=round(cuotas_patrón_r+self.tabla_amortización.sum(numeric_only=True).Total,2)
        serie['subtotal']=self.subtotal
        self.costo_financiero_porcentaje=self.get_costo_financiero_porcentaje(meses)
        serie['costo_financiero_porcentaje']=round(self.costo_financiero_porcentaje,2)
        self.costo_financiero=self.subtotal*self.costo_financiero_porcentaje
        serie['costo_financiero']=self.costo_financiero
        self.costo_administrativo=70000
        serie['costo_administrativo']=self.costo_administrativo
        self.costo_proyecto=self.subtotal+self.costo_financiero+self.costo_administrativo
        serie['costo_proyecto']=round(self.costo_proyecto,2)
        self.incremento_afore=self.subtotal*0.15
        serie['incremento_afore']=round(self.incremento_afore,2)
        self.costo_total_proyecto=max(85000,self.costo_proyecto)
        serie['costo_total_proyecto']=round(self.costo_total_proyecto,0)
        self.costo_beneficio=int((self.costo_total_proyecto/aportación_efg)*100)
        serie['c_costo_beneficio']=self.costo_beneficio
        serie['b_costo_beneficio']=100-self.costo_beneficio



        #Cálculo de crédito
        aplica_crédito_1=True
        plazo_crédito_1,plazo_crédito_2=60,36
        #crédito 1
        tabla_crédito_local_1=tablas_crédito.loc[:,tablas_crédito.columns.get_level_values(0)==plazo_crédito_1].set_index((plazo_crédito_1,'Desc. Nomina'))
        pago_total_1,monto_crédito_1=self.lookup(pensión_mensual_aumentada*0.30,tabla_crédito_local_1)
        self.monto_de_crédito_1=min(300000,monto_crédito_1) if aplica_crédito_1 else 0
        serie['monto_de_credito_1']=round(self.monto_de_crédito_1,2)

        #Primer_Depósito Pensión Autorizado
        self.primer_deposito_pension_autorizado=pensión_mensual_aumentada*3
        serie['primer_deposito_pension_autorizado']=round(self.primer_deposito_pension_autorizado,2)        
        #Primer Depósito Pensión pagado
        self.primer_depósito_pensión_pagado=min(self.costo_total_proyecto-self.monto_de_crédito_1,self.primer_deposito_pension_autorizado)
        serie['primer_deposito_pension']=int(round(self.primer_depósito_pensión_pagado,0))

        #Afore e infonavit autorizado
        self.afore_e_infonavit_mejorado=saldo_afore_original+self.incremento_afore
        self.afore_e_infonavit_mejorado_pago=min(self.costo_total_proyecto-self.monto_de_crédito_1-self.primer_depósito_pensión_pagado,self.afore_e_infonavit_mejorado)
        serie['afore_e_infonavit_mejorado']=int(round(self.afore_e_infonavit_mejorado_pago,0))

        #Aportación unica
        self.suma_pagos=self.monto_de_crédito_1+self.primer_depósito_pensión_pagado+self.afore_e_infonavit_mejorado_pago
        serie['suma_pagos']=round(self.suma_pagos,2)

        self.aportación_única_cliente=self.costo_total_proyecto-self.suma_pagos
        serie['aportacion_unica_cliente']=int(round(self.aportación_única_cliente,0))

        #Pensión
        self.inmediata=pensión_mensual_aumentada*0.70 if aplica_crédito_1 else pensión_mensual_aumentada
        serie['inmediata']=round(self.inmediata,2)
        self.al_concluir_crédito_1=pensión_mensual_aumentada
        serie['al_concluir_credito_1']=round(self.al_concluir_crédito_1,2)
        self.serie=serie.copy()
        
        

    @staticmethod    
    def get_uma(año):
        return Cálculo_Pensión.get_uma(año)
    @staticmethod
    def lookup(number,df:pd.DataFrame):
        serie_diagnóstico=df.index<number
        if serie_diagnóstico.sum()==0:
            return df.tail(1).values[0]
        else:            
            return df[serie_diagnóstico].tail(1).values[0].tolist()    


    @staticmethod
    def get_costo_financiero_porcentaje(meses:int)        :
        if (meses>=0)&(meses<13):
            porcentaje=0.50
        elif (meses>=13)&(meses<18):
            porcentaje=0.50
        else:
            porcentaje=0.50
        return porcentaje


    # def genr_tabla_amortización(self,meses:int,cuota_mensual:float,fecha_alta:datetime.datetime,tasa_m40:float):
    def genr_tabla_amortización(self,meses:int,fecha_alta:datetime.datetime,tasa_m40:float):
        cuotas_mensuales_por_año={2022:.10075,
                                  2023:.11166,
                                  2024:.12256,
                                  2025:.13347,
                                  2026:.14438,
                                  2027:.15528,
                                  2028:.16619,
                                  2029:.17709,
                                  2030:.18800}
        tabla=pd.DataFrame()
        
        #Generamos tablas para los mess
        for idx,mes in enumerate(range(1,meses+1)):
            tabla.loc[idx,'Mes_Número']=mes
            tabla.loc[idx,'Mes_Fecha']=fecha_alta+pd.DateOffset(months=idx)
        #Complementamos con valor anuales            
        tabla['Año']=tabla.Mes_Fecha.dt.year
        tabla['uma']=tabla.Año.apply(lambda x: self.get_uma(x))
        tabla['salario_mensual_topado']=tabla.uma*30.4*25
        tabla['porcentaje_cuota']=tabla.Año.apply(lambda x: cuotas_mensuales_por_año[max(min(x,2030),2022)])
        tabla['Cuota']=tabla.salario_mensual_topado*tabla.porcentaje_cuota
        # recargos=meses*tasa_m40*cuota_mensual
        tabla['Recargos']=meses*tasa_m40*tabla.Cuota
        tabla['Total']=tabla.Cuota+tabla.Recargos
        tabla['comentarios']='1:El salario mensual topado va cambiando conforme a la uma?  en el cálculo del salario promedio se mantiene fijo en el año del movimiento.\n\
                                  2: Los recargos son el número de meses que dura la modalidad 40*tasa_m40*cuota_mensual'
        return tabla


