# %%
class Mejora_de_Pensión(Cálculo_Pensión):
    """Realiza un cálculo de mejora de pensión. Con los siguientes parámetros:
        Fecha baja: marcada en sisec
        Fecha reactivacio´n: Día natural siguiente de la fecha de baja
        Fecha de baja de reactivación: Final del mes actual  """
    # def __init__(self,nombre:str,edad:int,salario_promedio:float,semanas_cotizadas:int,tipo_cálculo:str,fecha_baja_uma:datetime.datetime,ultimo_salario_mensual:float,mínimo_semanas=500,transitorio_14=1.11,salario_topado=25):

    def __init__(self,nombre:str,edad_actual:int, salario_promedio_diario:float,semanas_cotizadas_actuales:int,tipo_cálculo:str,fecha_baja_uma:datetime.datetime,último_salario_mensual:float,cuantía_incrementos:pd.DataFrame):
        #Generamos variables
        self.producto="Mejora Pensión"
        self.tablas_crédito=tablas_crédito.copy()
        self.cuantía_incrementos=cuantía_incrementos.copy()
        self.nombre=nombre
        self.edad=edad_actual
        self.último_salario_mensual=último_salario_mensual
        self.fecha_baja=fecha_baja_uma
        self.uma=self.get_uma(fecha_baja_uma.year)
        self.tipo_cálculo=tipo_cálculo
        self.serie_pensión=self.genr_pensión_aumentada(salario_promedio_diario,semanas_cotizadas_actuales) 
        self.pension_neta_mensual=self.serie_pensión.pension_neta_mensual  

    def genr_pensión_aumentada(self,salario_promedio:float,semanas_cotizadas:int):
        self.fecha_reactivacion=self.fecha_baja+datetime.timedelta(1)
        self.fecha_baja_reactivación=datetime.datetime.now()+pd.tseries.offsets.MonthEnd(0)
        self.salario_promedio_nuevo=self.calcular_salario_promedio_aumentado(salario_promedio,self.fecha_reactivacion,self.fecha_baja_reactivación)
        self.semanas_cotizadas_nuevas=int(((self.fecha_baja_reactivación-self.fecha_reactivacion).days/7 )+semanas_cotizadas)
        serie_pensión=Cálculo_Pensión(self.nombre,self.edad,self.salario_promedio_nuevo,self.semanas_cotizadas_nuevas,self.tipo_cálculo,self.fecha_baja,self.último_salario_mensual,self.cuantía_incrementos).serie_pensión.copy()
        return serie_pensión

    def calcular_salario_promedio_aumentado(self,salario_promedio_actual:float,fecha_reactivación:datetime.datetime,fecha_baja_reactivación:datetime.datetime):
        self.meses_mod_40=int(np.floor((fecha_baja_reactivación-fecha_reactivación).days/30.4))

        salario_mensual_topado=25*(self.uma)*30.4
        # self.salario_mensual_topado=salario_mensual_topado
        
        # self.cuota_mensual=salario_mensual_topado*.10075
        salario_diario_topado=salario_mensual_topado/30.4
        self.salario_diario_topado=salario_diario_topado

        meses_mod_40_ajustado=min(self.meses_mod_40,59)
        self.meses_mod_40_ajustado=meses_mod_40_ajustado

        salario_mensual_a_contratar=salario_diario_topado*meses_mod_40_ajustado*30.4
        self.salario_mensual_a_contratar=salario_mensual_a_contratar

        salario_promedio_mensual_actual_ajustado=(60-meses_mod_40_ajustado)*30.4*salario_promedio_actual
        # self.salario_promedio_mensual_actual_ajustado=salario_promedio_mensual_actual_ajustado

        suma_salarios=(salario_mensual_a_contratar+salario_promedio_mensual_actual_ajustado)
        salario_promedio_nuevo=(suma_salarios/60)/30.4

        return salario_promedio_nuevo


