# %%
class Incrementos_Pensión:
    def __init__(self,pensión_original:Cálculo_Pensión,pensión_mejorada:Mejora_de_Pensión):
        # incrementos=pd.Series(dtype='object',name='incrementos')
        mejorada_filtrada=self.filtrar_serie_por_tipo(pensión_mejorada.serie_pensión,float,int)
        original_filtrada=self.filtrar_serie_por_tipo(pensión_original.serie_pensión,float,int)
        self.incrementos=mejorada_filtrada-original_filtrada
        self.incrementos.name='incrementos'
        self.incrementos['tipo_calculo']='incrementos'
        self.incrementos['porcentaje_incremento']=int((self.incrementos['pension_neta_mensual']/pensión_original.serie_pensión['pension_neta_mensual'])*100)
        self.incrementos['cobro_80']=(80-pensión_mejorada.serie_pensión['edad'])*pensión_mejorada.serie_pensión['pension_neta_anual']
        self.incrementos['aportacion_efg']=(80-pensión_mejorada.serie_pensión['edad'])*self.incrementos['pension_neta_anual']        
        self.incrementos['nombre']=pensión_original.nombre
        for index,values in self.incrementos.items():
            setattr(self,index,values)

        
    @staticmethod
    def filtrar_serie_por_tipo(serie:pd.Series,*tipos):
        filtro=serie.apply(lambda x: isinstance(x,tipos))
        return serie[filtro].copy()
  


